/// Returns a reference to the entry's key.
///
/// # Examples
///
/// ```
/// # use http::header::{HeaderMap, Entry, HOST};
/// let mut map = HeaderMap::new();
/// map.insert(HOST, "world".parse().unwrap());
///
/// if let Entry::Occupied(e) = map.entry("host") {
///     assert_eq!("host", e.key());
/// }
/// ```
